/\/ru.wikipedia.org\/wiki\/1320_%D0%B3%D0%BE%D0%B4\" title=\"1320 \u0433\u043e\u0434\">1320<\/a>&#160;\u2014 \u0434\u0443\u0445\u043e\u0432\u0435\u043d\u0441\u0442\u0432\u043e\u043c \u0438 \u0431\u0430\u0440\u043e\u043d\u0430\u043c\u0438 \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0438 \u0432\u043e \u0433\u043b\u0430\u0432\u0435 \u0441 \u0430\u0431\u0431\u0430\u0442\u043e\u043c \u0410\u0440\u0431\u0440\u043e\u0442\u0441\u043a\u043e\u0433\u043e \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044f \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%B1%D1%80%D0%BE%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%B4%D0%B5%D0%BA%D0%BB%D0%B0%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0410\u0440\u0431\u0440\u043e\u0442\u0441\u043a\u0430\u044f \u0434\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u044f\">\u0410\u0440\u0431\u0440\u043e\u0442\u0441\u043a\u0430\u044f \u0434\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u044f<\/a>, \u043f\u043e\u0434\u0442\u0432\u0435\u0440\u0436\u0434\u0430\u0432\u0448\u0430\u044f \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1327_%D0%B3%D0%BE%D0%B4\" title=\"1327 \u0433\u043e\u0434\">1327<\/a>&#160;\u2014 \u0432 \u0446\u0435\u0440\u043a\u0432\u0438 \u0421\u0432\u044f\u0442\u043e\u0439 \u041a\u043b\u0430\u0440\u044b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D0%B8%D0%BD%D1%8C%D0%BE%D0%BD\" title=\"\u0410\u0432\u0438\u043d\u044c\u043e\u043d\">\u0410\u0432\u0438\u043d\u044c\u043e\u043d\u0435<\/a> \u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u0439 \u043f\u043e\u044d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%87%D0%B5%D1%81%D0%BA%D0%BE_%D0%9F%D0%B5%D1%82%D1%80%D0%B0%D1%80%D0%BA%D0%B0\" title=\"\u0424\u0440\u0430\u043d\u0447\u0435\u0441\u043a\u043e \u041f\u0435\u0442\u0440\u0430\u0440\u043a\u0430\">\u0424\u0440\u0430\u043d\u0447\u0435\u0441\u043a\u043e \u041f\u0435\u0442\u0440\u0430\u0440\u043a\u0430<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u043e\u0432\u0441\u0442\u0440\u0435\u0447\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%83%D1%80%D0%B0_(%D0%9F%D0%B5%D1%82%D1%80%D0%B0%D1%80%D0%BA%D0%B0)\" title=\"\u041b\u0430\u0443\u0440\u0430 (\u041f\u0435\u0442\u0440\u0430\u0440\u043a\u0430)\">\u041b\u0430\u0443\u0440\u0443<\/a>, \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u043f\u043e\u043b\u044e\u0431\u0438\u043b \u0441 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0432\u0437\u0433\u043b\u044f\u0434\u0430 . \u041f\u043e\u0442\u043e\u043c \u043e\u043d \u0434\u0435\u0441\u044f\u0442\u043a\u0438 \u043b\u0435\u0442 \u0432\u043e\u0441\u043f\u0435\u0432\u0430\u043b \u0435\u0451 \u0432 \u0441\u0432\u043e\u0438\u0445 \u0441\u043e\u043d\u0435\u0442\u0430\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1362_%D0%B3%D0%BE%D0%B4\" title=\"1362 \u0433\u043e\u0434\">1362<\/a>&#160;\u2014 \u0432\u043e \u0432\u0440\u0435\u043c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BB%D0%B5%D1%82%D0%BD%D1%8F%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0421\u0442\u043e\u043b\u0435\u0442\u043d\u044f\u044f \u0432\u043e\u0439\u043d\u0430\">\u0421\u0442\u043e\u043b\u0435\u0442\u043d\u0435\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%91%D1%80%D0%B8%D0%BD%D1%8C%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0411\u0440\u0438\u043d\u044c\u0435\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0411\u0440\u0438\u043d\u044c\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1384_%D0%B3%D0%BE%D0%B4\" title=\"1384 \u0433\u043e\u0434\">1384<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82%D1%83%D0%B3%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5_%D0%BC%D0%B5%D0%B6%D0%B4%D1%83%D1%86%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B8%D0%B5\" title=\"\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u044c\u0441\u043a\u043e\u0435 \u043c\u0435\u0436\u0434\u0443\u0446\u0430\u0440\u0441\u0442\u0432\u0438\u0435\">\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u044c\u0441\u043a\u043e\u0435 \u043c\u0435\u0436\u0434\u0443\u0446\u0430\u0440\u0441\u0442\u0432\u0438\u0435<\/a>: \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%90%D1%82%D0%BE%D0%BB%D0%B5%D0%B9%D1%80%D1%83%D1%88%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0410\u0442\u043e\u043b\u0435\u0439\u0440\u0443\u0448\u0435\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0410\u0442\u043e\u043b\u0435\u0439\u0440\u0443\u0448\u0435<\/a>, \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u0432\u0448\u0430\u044f\u0441\u044f \u043f\u043e\u0431\u0435\u0434\u043e\u0439 \u043f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u044c\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1385_%D0%B3%D0%BE%D0%B4\" title=\"1385 \u0433\u043e\u0434\">1385<\/a>&#160;\u2014 \u043d\u0430 \u043a\u043e\u0440\u0442\u0435\u0441 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%B8%D0%BC%D0%B1%D1%80%D0%B0\" title=\"\u041a\u043e\u0438\u043c\u0431\u0440\u0430\">\u041a\u043e\u0438\u043c\u0431\u0440\u0435<\/a> \u043a\u043e\u0440\u043e\u043b\u0451\u043c \u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u0438 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D1%83%D0%B0%D0%BD_I\" title=\"\u0416\u0443\u0430\u043d I\">\u0416\u0443\u0430\u043d I<\/a>, \u0441\u0442\u0430\u0432\u0448\u0438\u0439 \u043f\u0435\u0440\u0432\u044b\u043c \u043c\u043e\u043d\u0430\u0440\u0445\u043e\u043c \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D0%B8%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%B4%D0%B8%D0%BD%D0%B0%D1%81%D1%82%D0%B8%D1%8F\" title=\"\u0410\u0432\u0438\u0441\u0441\u043a\u0430\u044f \u0434\u0438\u043d\u0430\u0441\u0442\u0438\u044f\">\u0410\u0432\u0438\u0441\u0441\u043a\u043e\u0439 \u0434\u0438\u043d\u0430\u0441\u0442\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1580_%D0%B3%D0%BE%D0%B4\" title=\"1580 \u0433\u043e\u0434\">1580<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0411\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u0434\u0440\u043e\u0436\u0430\u043d\u0438\u0435 \u0437\u0435\u043c\u043b\u0438 \u0440\u0430\u0437\u0440\u0443\u0448\u0438\u043b\u043e \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u0438\u0435 \u0445\u0440\u0430\u043c\u044b, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u0441\u0442\u0430\u0440\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B1%D0%BE%D1%80_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%9F%D0%B0%D0%B2%D0%BB%D0%B0\" title=\"\u0421\u043e\u0431\u043e\u0440 \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u041f\u0430\u0432\u043b\u0430\">\u0421\u043e\u0431\u043e\u0440 \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u041f\u0430\u0432\u043b\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1652_%D0%B3%D0%BE%D0%B4\" title=\"1652 \u0433\u043e\u0434\">1652<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%8B\" title=\"\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b\">\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0435\u0446<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%B1%D0%B5%D0%BA,_%D