=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0421\u0428\u0410\">\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0421\u0428\u0410<\/a>: \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BF%D0%BF%D0%BE%D0%BC%D0%B0%D1%82%D1%82%D0%BE%D0%BA%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0410\u043f\u043f\u043e\u043c\u0430\u0442\u0442\u043e\u043a\u0441\u0441\u043a\u0430\u044f \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u044f\">\u0410\u043f\u043f\u043e\u043c\u0430\u0442\u0442\u043e\u043a\u0441\u0441\u043a\u043e\u0439 \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u0438<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%A1%D0%B0%D0%B9%D0%BB%D0%B5%D1%80%D1%81-%D0%9A%D1%80%D0%B8%D0%BA\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0421\u0430\u0439\u043b\u0435\u0440\u0441-\u041a\u0440\u0438\u043a\">\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0421\u0430\u0439\u043b\u0435\u0440\u0441-\u041a\u0440\u0438\u043a<\/a>, \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u0432\u0448\u0435\u0435\u0441\u044f \u043f\u043e\u0431\u0435\u0434\u043e\u0439 \u0430\u0440\u043c\u0438\u0438 \u0421\u043e\u044e\u0437\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1893_%D0%B3%D0%BE%D0%B4\" title=\"1893 \u0433\u043e\u0434\">1893<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%BB%D1%82-%D0%9B%D0%B5%D0%B9%D0%BA-%D0%A1%D0%B8%D1%82%D0%B8\" title=\"\u0421\u043e\u043b\u0442-\u041b\u0435\u0439\u043a-\u0421\u0438\u0442\u0438\">\u0421\u043e\u043b\u0442-\u041b\u0435\u0439\u043a-\u0421\u0438\u0442\u0438<\/a> \u043e\u0441\u0432\u044f\u0449\u0451\u043d \u0441\u0430\u043c\u044b\u0439 \u0431\u043e\u04