;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043f\u0443\u0449\u0435\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D1%80%D0%B0%D0%BC%D0%B2%D0%B0%D0%B9\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u0442\u0440\u0430\u043c\u0432\u0430\u0439\">\u0442\u0440\u0430\u043c\u0432\u0430\u0439<\/a> . \u041a\u0443\u0440\u0441\u0438\u0440\u043e\u0432\u0430\u043b \u043e\u043d \u0441 \u0438\u043d\u0442\u0435\u0440\u0432\u0430\u043b\u043e\u043c \u0432 14 \u043c\u0438\u043d\u0443\u0442. \u0411\u0438\u043b\u0435\u0442 \u043f\u043e \u0432\u0441\u0435\u0439 \u043b\u0438\u043d\u0438\u0438 \u0441\u0442\u043e\u0438\u043b 6 \u043a\u043e\u043f\u0435\u0435\u043a.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1903_%D0%B3%D0%BE%D0%B4\" title=\"1903 \u0433\u043e\u0434\">1903<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%88%D0%B8%D0%BD%D1%91%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%B3%D1%80%D0%BE%D0%BC_(1903)\" class=\"mw-redirect\" title=\"\u041a\u0438\u0448\u0438\u043d\u0451\u0432\u0441\u043a\u0438\u0439 \u043f\u043e\u0433\u0440\u043e\u043c (1903)\">\u043a\u0438\u0448\u0438\u043d\u0451\u0432\u0441\u043a\u0438\u0439 \u043f\u043e\u0433\u0440\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1909_%D0%B3%D0%BE%D0%B4\" title=\"1909 \u0433\u043e\u0434\">1909<\/a>&#160;\u2014 \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D1%80%D0%B8,_%D0%A0%D0%