=\"https:\/\/ru.wikipedia.org\/wiki\/1965_%D0%B3%D0%BE%D0%B4\" title=\"1965 \u0433\u043e\u0434\">1965<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0437\u0430\u043f\u0443\u0449\u0435\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u043a\u043e\u043c\u043c\u0435\u0440\u0447\u0435\u0441\u043a\u0438\u0439 \u0441\u043f\u0443\u0442\u043d\u0438\u043a \u0441\u0432\u044f\u0437\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A0%D0%B0%D0%BD%D0%BD%D1%8F%D1%8F_%D0%9F%D1%82%D0%B0%D1%88%D0%BA%D0%B0&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0420\u0430\u043d\u043d\u044f\u044f \u041f\u0442\u0430\u0448\u043a\u0430 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0420\u0430\u043d\u043d\u044f\u044f \u041f\u0442\u0430\u0448\u043a\u0430<\/a>\u00bb, \u0440\u0430\u0431\u043e\u0442\u0430\u044e\u0449\u0438\u0439 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BE%D1%81%D1%82%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D1%80%D0%BD%D0%B0%D1%8F_%D0%BE%D1%80%D0%B1%D0%B8%D1%82%D0%B0\" title=\"\u0413\u0435\u043e\u0441\u0442\u0430\u0446\u0438\u043e\u043d\u0430\u0440\u043d\u0430\u044f \u043e\u0440\u0431\u0438\u0442\u0430\">\u0433\u0435\u043e\u0441\u0442\u0430\u0446\u0438\u043e\u043d\u0430\u0440\u043d\u043e\u0439 \u043e\u0440\u0431\u0438\u0442\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 \u0410\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BA-28\" title=\"\u042f\u043a-28\">\u042f\u043a-28<\/a> (\u044d\u043a\u0438\u043f\u0430\u0436: \u043b\u0451\u0442\u0447\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BF%D1%83%D1%81%D1%82%D0%B8%D0%BD,_%D0%91%D0%BE%D1%80%D0%B8%D1%81_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D1%81%D0%BB%D0%B0%D0%B2%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0430\u043f\u0443\u0441\u0442\u0438\u043d, \u0411\u043e\u0440\u0438\u0441 \u0412\u043b\u0430\u0434\u0438\u0441\u043b\u0430\u0432\u043e\u0432\u0438\u0447\">\u041a\u0430\u043f\u0443\u0441\u0442\u0438\u043d \u0411. \u0412.<\/a>, \u0448\u0442\u0443\u0440\u043c\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BD%D0%BE%D0%B2,_%D0%AE%D1%80%D0%B8%D0%B9_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u042f\u043d\u043e\u0432, \u042e\u0440\u0438\u0439 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u042f\u043d\u043e\u0432 \u042e. \u041d.<\/a>). \u0423\u0432\u043e\u0434\u044f \u043f\u0430\u0434\u0430\u044e\u0449\u0438\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 \u043e\u0442 \u0436\u0438\u043b\u044b\u0445 \u043a\u0432\u0430\u0440\u0442\u0430\u043b\u043e\u0432 \u0417\u0430\u043f\u0430\u0434\u043d\u043e\u0433\u043e \u0411\u0435\u0440\u043b\u0438\u043d\u0430, \u043b\u0451\u0442\u0447\u0438\u043a\u0438, \u043e\u0442\u043a\u0430\u0437\u0430\u0432\u0448\u0438\u0441\u044c \u043e\u0442 \u043a\u0430\u0442\u0430\u043f\u0443\u043b\u044c\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f, \u0443\u043f\u0430\u043b\u0438 \u0432 \u043e\u0437\u0435\u0440\u043e \u0428\u0442\u0451\u0441\u0441\u0435\u043d\u0437\u0435\u0435. \u041d\u0430 \u0442\u0440\u0430\u0443\u0440\u043d\u0443\u044e \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u044e 8 \u0430\u043f\u0440\u0435\u043b\u044f \u0431\u044b\u043b\u0438 \u043e\u0442\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u044b \u0434\u0435\u043b\u0435\u0433\u0430\u0446\u0438\u0438 \u043e\u0442 \u043a\u0430\u0436\u0434\u043e\u0433\u043e \u0433\u043e\u0440\u043e\u0434\u0430 \u0413\u0414\u0420 \u0438 \u0424\u0420\u0413 . 10 \u043c\u0430\u044f \u043e\u0431\u0430 \u043b\u0451\u0442\u0447\u0438\u043a\u0430 \u043f\u043